class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        lst = []

        n = len(board)
        m = len(board[0])

        for i in range(n):
            for j in range(m):
                lst.append((board[i][j], i, j))

        lst.sort(key = lambda t: t[0], reverse=True)

        cur_max = -999999999999

        for first in range(0, (n) + 1):            
            for second in range(first + 1, first + n + m + 1):

                if second >= len(lst): 
                    break

                if (lst[second][1] == lst[first][1] or lst[second][2] == lst[first][2]):
                    continue


                for third in range(second + 1, second + (n + m) + 2):

                    if third >= len(lst): 
                        break

                    if ((lst[third][1] == lst[first][1] or lst[third][2] == lst[first][2]) or (lst[second][1] == lst[third][1] or lst[second][2] == lst[third][2])):
                        continue

                    if (lst[first][0] + lst[second][0] + lst[third][0] > cur_max):
                        cur_max = lst[first][0] + lst[second][0] + lst[third][0]

                        break


        return cur_max
